pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "base64-sol/base64.sol";
//SPDX-License-Identifier: UNLICENSED
contract TestNFT is ERC721Enumerable, ERC721URIStorage{
    uint256 public tokenCounter;
    event CreatedTESTNFT(uint256 indexed tokenId, string tokenURI);
    constructor () ERC721("Testie", "TEST"){
        tokenCounter = 0;
    }

    function createTest(string memory _svg) public returns (uint256){
        uint256 newItemId = tokenCounter;
        _safeMint(msg.sender, newItemId);
        string memory imageURI = svgToImageURI(_svg);
        string memory formattedTokenURI = formatTokenURI(imageURI);
        _setTokenURI(newItemId, formattedTokenURI);
        emit CreatedTESTNFT(tokenCounter, formattedTokenURI);
        tokenCounter = tokenCounter + 1;
        return newItemId;
    }

    function svgToImageURI(string memory _svg) public pure returns (string memory){
        string memory baseURL = "data:image/svg+xml;base64,";
        string memory svgBase64Encoded = Base64.encode(bytes(string(abi.encodePacked(_svg))));
        string memory imageURI = string(abi.encodePacked(baseURL, svgBase64Encoded));

        return imageURI;
    }

    function formatTokenURI(string memory _imageURI) public pure returns (string memory){
        string memory baseURL = "data:application/json;base64,";
        return string(abi.encodePacked(
            baseURL, 
            Base64.encode(
                bytes(abi.encodePacked(
                    '{"name": "MorseNFT",', 
                    '"description": "Morse Code NFT",', 
                    '"attributes": "",', 
                    '"image":', _imageURI, '}'
                    )
                ))
            ));
    }


    //Open Zeppelin
    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        override(ERC721, ERC721Enumerable)
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

}
